(104, 39, NULL, 'admin', NULL, 'I was able to replicate the issue. I will circle back with Carley on what could be causing this. Stay tuned. Also, I saw a bunch of Image uploads, thanks! Is it safe to say all of this material is approved to use to start building out our content calendar?', 0, NULL, NULL, '2025-10-24 15:56:45', 1, 0, 0, 0, 0, 0),
(105, 39, NULL, 'admin', NULL, 'Sent you both a Google Drive link with a note attached. Please let me know that you received it!  I know I am asking for raw vido, and we are currently battling the video upload issue in MediaHub, for now, feel free to drop any videos within the Google Drive I shared as a safeguard until MediaHub video uploads is fixed.', 0, NULL, NULL, '2025-10-24 18:00:24', 1, 0, 0, 0, 0, 0),
(106, 39, 19, 'store', NULL, 'Sorry for the delayed response! I just wanted to confirm that all of the material added is approved and safe to post!', 0, NULL, NULL, '2025-10-27 13:48:34', 1, 1, 0, 0, 0, 0),
(107, 39, NULL, 'admin', NULL, 'Okay great - I did speak with Carley on the video upload issue. If you have any pre-recorded videos on your devices that you want us to utilize, please add them to the Drive folder I shared with you all. Moving forward, all videos you want to add into MediaHub need to be recorded with modified Camera Settings. This will not impact the quality, but it will allow for the proper format to be uploaded to MediaHub. To update your Apple devices camera settings to submit in the most compatible format, navigate to settings, tap your camera settings.  Select format. Turn ON \"most compatible\". Be sure that Apple ProRes is toggled off.', 0, NULL, NULL, '2025-10-27 15:42:29', 1, 0, 0, 0, 0, 0),
(108, 41, 23, 'store', NULL, 'I\'m in!', 0, NULL, NULL, '2025-10-28 17:57:04', 1, 1, 0, 0, 0, 0),
